import React from "react";
import "../../css/Rides.css"
import radiator from "../../images/radiator.png";

const Rides = () => {
    return (
        <>
            <h2 className="">Rides</h2>
            <div className="ride-box-container">
                    <img className="radiator" src={radiator} alt="company logo"></img>
                    <p className="ridename">Radiator Springs Racers</p>
            </div>
        </>
    )
}

export default Rides;
